    "Additional posts could not be loaded. Refresh the page and try again.": "\u0c05\u0c26\u0c28\u0c2a\u0c41 \u0c2a\u0c4b\u0c38\u0c4d\u0c1f\u0c4d\u200c\u0c32\u0c28\u0c41 \u0c32\u0c4b\u0c21\u0c4d \u0c1a\u0c47\u0c2f\u0c21\u0c02 \u0c38\u0c3e\u0c27\u0c4d\u0c2f\u0c2a\u0c21\u0c32\u0c47\u0c26\u0c41. \u0c2a\u0c47\u0c1c\u0c40\u0c28\u0c3f \u0c30\u0c3f\u0c2b\u0c4d\u0c30\u0c46\u0c37\u0c4d \u0c1a\u0c47\u0c38\u0c3f, \u0c2e\u0c33\u0c4d\u0c32\u0c40 \u0c2a\u0c4d\u0c30\u0c2f\u0c24\u0c4d\u0c28\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f.",
    "Additional responses could not be loaded. Refresh the page and try again.": "\u0c05\u0c26\u0c28\u0c2a\u0c41 \u0c2a\u0c4d\u0c30\u0c24\u0c3f\u0c38\u0c4d\u0c2a\u0c02\u0c26\u0c28\u0c32\u0c28\u0c41 \u0c32\u0c4b\u0c21\u0c4d \u0c1a\u0c47\u0c2f\u0c21\u0c02 \u0c38\u0c3e\u0c27\u0c4d\u0c2f\u0c2a\u0c21\u0c32\u0c47\u0c26\u0c41. \u0c2a\u0c47\u0c1c\u0c40\u0c28\u0c3f \u0c30\u0c3f\u0c2b\u0c4d\u0c30\u0c46\u0c37\u0c4d \u0c1a\u0c47\u0c38\u0c3f, \u0c2e\u0c33\u0c4d\u0c32\u0c40 \u0c2a\u0c4d\u0c30\u0c2f\u0c24\u0c4d\u0c28\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f.",
    "Adjust video speed": "\u0c35\u0c40\u0c21\u0c3f\u0c2f\u0c4b \u0c35\u0c47\u0c17\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c38\u0c30\u0c4d\u0c26\u0c41\u0c2c\u0c3e\u0c1f\u0c41 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Adjust video volume": "\u0c35\u0c40\u0c21\u0c3f\u0c2f\u0c4b \u0c35\u0c3e\u0c32\u0c4d\u0c2f\u0c42\u0c2e\u0c4d\u200c\u0c28\u0c41 \u0c38\u0c30\u0c4d\u0c26\u0c41\u0c2c\u0c3e\u0c1f\u0c41 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Admin": "\u0c05\u0c21\u0c4d\u0c2e\u0c3f\u0c28\u0c4d",
    "Advanced": "\u0c06\u0c27\u0c41\u0c28\u0c3f\u0c15",
    "After the course\\'s end date has passed, learners can no longer access subsection content. The subsection remains included in grade calculations.": "\u0c15\u0c4b\u0c30\u0c4d\u0c38\u0c41 \u0c2e\u0c41\u0c17\u0c3f\u0c02\u0c2a\u0c41 \u0c24\u0c47\u0c26\u0c40 \u0c2e\u0c41\u0c17\u0c3f\u0c38\u0c3f\u0c28 \u0c24\u0c30\u0c4d\u0c35\u0c3e\u0c24, \u0c05\u0c2d\u0c4d\u0c2f\u0c3e\u0c38\u0c15\u0c41\u0c32\u0c41 \u0c07\u0c15\u0c2a\u0c48 \u0c09\u0c2a\u0c35\u0c3f\u0c2d\u0c3e\u0c17\u0c02 \u0c15\u0c02\u0c1f\u0c46\u0c02\u0c1f\u0c4d\u200c\u0c28\u0c41 \u0c2f\u0c3e\u0c15\u0c4d\u0c38\u0c46\u0c38\u0c4d \u0c1a\u0c47\u0c2f\u0c32\u0c47\u0c30\u0c41. \u0c09\u0c2a\u0c35\u0c3f\u0c2d\u0c3e\u0c17\u0c02 \u0c17\u0c4d\u0c30\u0c47\u0c21\u0c4d \u0c32\u0c46\u0c15\u0c4d\u0c15\u0c32\u0c4d\u0c32\u0c4b \u0c1a\u0c47\u0c30\u0c4d\u0c1a\u0c2c\u0c21\u0c3f\u0c02\u0c26\u0c3f.",
    "After the subsection\\'s due date has passed, learners can no longer access its content. The subsection remains included in grade calculations.": "\u0c09\u0c2a\u0c35\u0c3f\u0c2d\u0c3e\u0c17\u0c02 \u0c2f\u0c4a\u0c15\u0c4d\u0c15 \u0c17\u0c21\u0c41\u0c35\u0c41 \u0c24\u0c47\u0c26\u0c40 \u0c2e\u0c41\u0c17\u0c3f\u0c38\u0c3f\u0c28 \u0c24\u0c30\u0c4d\u0c35\u0c3e\u0c24, \u0c05\u0c2d\u0c4d\u0c2f\u0c3e\u0c38\u0c15\u0c41\u0c32\u0c41 \u0c07\u0c15\u0c2a\u0c48 \u0c26\u0c3e\u0c28\u0c3f \u0c15\u0c02\u0c1f\u0c46\u0c02\u0c1f\u0c4d\u200c\u0c28\u0c41 \u0c2f\u0c3e\u0c15\u0c4d\u0c38\u0c46\u0c38\u0c4d \u0c1a\u0c47\u0c2f\u0c32\u0c47\u0c30\u0c41. \u0c09\u0c2a\u0c35\u0c3f\u0c2d\u0c3e\u0c17\u0c02 \u0c17\u0c4d\u0c30\u0c47\u0c21\u0c4d \u0c32\u0c46\u0c15\u0c4d\u0c15\u0c32\u0c4d\u0c32\u0c4b \u0c1a\u0c47\u0c30\u0c4d\u0c1a\u0c2c\u0c21\u0c3f\u0c02\u0c26\u0c3f.",
    "Align center": "\u0c2e\u0c27\u0c4d\u0c2f\u0c15\u0c41 \u0c38\u0c2e\u0c32\u0c47\u0c16\u0c28\u0c02 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Align left": "\u0c0e\u0c21\u0c2e\u0c15\u0c41 \u0c38\u0c2e\u0c32\u0c47\u0c16\u0c28\u0c02 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
