    "Are you sure you want to delete this update?": "\u0c2e\u0c40\u0c30\u0c41 \u0c08 \u0c28\u0c35\u0c40\u0c15\u0c30\u0c23\u0c28\u0c41 \u0c16\u0c1a\u0c4d\u0c1a\u0c3f\u0c24\u0c02\u0c17\u0c3e \u0c24\u0c4a\u0c32\u0c17\u0c3f\u0c02\u0c1a\u0c3e\u0c32\u0c28\u0c41\u0c15\u0c41\u0c02\u0c1f\u0c41\u0c28\u0c4d\u0c28\u0c3e\u0c30\u0c3e?",
    "Are you sure you want to delete {email} from the course team for \u201c{container}\u201d?": "\u0c2e\u0c40\u0c30\u0c41 \u201c {container} \u201d \u0c15\u0c4b\u0c38\u0c02 \u0c15\u0c4b\u0c30\u0c4d\u0c38\u0c41 \u0c2c\u0c43\u0c02\u0c26\u0c02 \u0c28\u0c41\u0c02\u0c21\u0c3f {email} \u0c16\u0c1a\u0c4d\u0c1a\u0c3f\u0c24\u0c02\u0c17\u0c3e \u0c24\u0c4a\u0c32\u0c17\u0c3f\u0c02\u0c1a\u0c3e\u0c32\u0c28\u0c41\u0c15\u0c41\u0c02\u0c1f\u0c41\u0c28\u0c4d\u0c28\u0c3e\u0c30\u0c3e?",
