    "Are you sure you want to unenroll from the verified {certNameLong} track of {courseName} ({courseNumber})?": "{courseName} ( {courseNumber} ) \u0c2f\u0c4a\u0c15\u0c4d\u0c15 \u0c27\u0c43\u0c35\u0c40\u0c15\u0c30\u0c3f\u0c02\u0c1a\u0c2c\u0c21\u0c3f\u0c28 {certNameLong} \u0c1f\u0c4d\u0c30\u0c3e\u0c15\u0c4d \u0c28\u0c41\u0c02\u0c21\u0c3f \u0c2e\u0c40\u0c30\u0c41 \u0c16\u0c1a\u0c4d\u0c1a\u0c3f\u0c24\u0c02\u0c17\u0c3e \u0c05\u0c28\u0c4d\u200c\u0c0e\u0c28\u0c4d\u200c\u0c30\u0c4b\u0c32\u0c4d \u0c1a\u0c47\u0c2f\u0c3e\u0c32\u0c28\u0c41\u0c15\u0c41\u0c02\u0c1f\u0c41\u0c28\u0c4d\u0c28\u0c3e\u0c30\u0c3e?",
    "Are you sure you want to unenroll from {courseName} ({courseNumber})?": "\u0c2e\u0c40\u0c30\u0c41 \u0c16\u0c1a\u0c4d\u0c1a\u0c3f\u0c24\u0c02\u0c17\u0c3e {courseName} ( {courseNumber} ) \u0c28\u0c41\u0c02\u0c21\u0c3f \u0c05\u0c28\u0c4d\u200c\u0c0e\u0c28\u0c4d\u200c\u0c30\u0c4b\u0c32\u0c4d \u0c1a\u0c47\u0c2f\u0c3e\u0c32\u0c28\u0c41\u0c15\u0c41\u0c02\u0c1f\u0c41\u0c28\u0c4d\u0c28\u0c3e\u0c30\u0c3e?",
    "Are you sure you want to unenroll from {courseName} ({courseNumber})? You will be refunded the amount you paid.": "\u0c2e\u0c40\u0c30\u0c41 \u0c16\u0c1a\u0c4d\u0c1a\u0c3f\u0c24\u0c02\u0c17\u0c3e {courseName} ( {courseNumber} ) \u0c28\u0c41\u0c02\u0c21\u0c3f \u0c05\u0c28\u0c4d\u200c\u0c0e\u0c28\u0c4d\u200c\u0c30\u0c4b\u0c32\u0c4d \u0c1a\u0c47\u0c2f\u0c3e\u0c32\u0c28\u0c41\u0c15\u0c41\u0c02\u0c1f\u0c41\u0c28\u0c4d\u0c28\u0c3e\u0c30\u0c3e? \u0c2e\u0c40\u0c30\u0c41 \u0c1a\u0c46\u0c32\u0c4d\u0c32\u0c3f\u0c02\u0c1a\u0c3f\u0c28 \u0c2e\u0c4a\u0c24\u0c4d\u0c24\u0c02 \u0c2e\u0c40\u0c15\u0c41 \u0c24\u0c3f\u0c30\u0c3f\u0c17\u0c3f \u0c07\u0c35\u0c4d\u0c35\u0c2c\u0c21\u0c41\u0c24\u0c41\u0c02\u0c26\u0c3f.",
    "Are you sure you wish to delete this item. It cannot be reversed!\n\nAlso any content that links/refers to this item will no longer work (e.g. broken images and/or links)": "\u0c2e\u0c40\u0c30\u0c41 \u0c16\u0c1a\u0c4d\u0c1a\u0c3f\u0c24\u0c02\u0c17\u0c3e \u0c08 \u0c05\u0c02\u0c36\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c24\u0c4a\u0c32\u0c17\u0c3f\u0c02\u0c1a\u0c3e\u0c32\u0c28\u0c41\u0c15\u0c41\u0c02\u0c1f\u0c41\u0c28\u0c4d\u0c28\u0c3e\u0c30\u0c3e. \u0c07\u0c26\u0c3f \u0c24\u0c3f\u0c30\u0c17\u0c2c\u0c21\u0c26\u0c41!\n\n \u0c05\u0c32\u0c3e\u0c17\u0c47 \u0c08 \u0c10\u0c1f\u0c46\u0c2e\u0c4d\u200c\u0c15\u0c41 \u0c32\u0c3f\u0c02\u0c15\u0c4d \u0c1a\u0c47\u0c38\u0c47/\u0c38\u0c42\u0c1a\u0c3f\u0c02\u0c1a\u0c47 \u0c0f\u0c26\u0c48\u0c28\u0c3e \u0c15\u0c02\u0c1f\u0c46\u0c02\u0c1f\u0c4d \u0c07\u0c15\u0c2a\u0c48 \u0c2a\u0c28\u0c3f \u0c1a\u0c47\u0c2f\u0c26\u0c41 (\u0c09\u0c26\u0c3e. \u0c35\u0c3f\u0c30\u0c3f\u0c17\u0c3f\u0c28 \u0c1a\u0c3f\u0c24\u0c4d\u0c30\u0c3e\u0c32\u0c41 \u0c2e\u0c30\u0c3f\u0c2f\u0c41/\u0c32\u0c47\u0c26\u0c3e \u0c32\u0c3f\u0c02\u0c15\u0c4d\u200c\u0c32\u0c41)",
    "Are you sure?": "\u0c2e\u0c40\u0c30\u0c41 \u0c1a\u0c46\u0c2a\u0c4d\u0c2a\u0c47\u0c26\u0c3f \u0c28\u0c3f\u0c1c\u0c2e\u0c3e?",
    "As part of the verification process, you take a photo of both your face and a government-issued photo ID. Our authorization service confirms your identity by comparing the photo you take with the photo on your ID.": "\u0c27\u0c43\u0c35\u0c40\u0c15\u0c30\u0c23 \u0c2a\u0c4d\u0c30\u0c15\u0c4d\u0c30\u0c3f\u0c2f\u0c32\u0c4b \u0c2d\u0c3e\u0c17\u0c02\u0c17\u0c3e, \u0c2e\u0c40\u0c30\u0c41 \u0c2e\u0c40 \u0c2e\u0c41\u0c16\u0c02 \u0c2e\u0c30\u0c3f\u0c2f\u0c41 \u0c2a\u0c4d\u0c30\u0c2d\u0c41\u0c24\u0c4d\u0c35\u0c02 \u0c1c\u0c3e\u0c30\u0c40 \u0c1a\u0c47\u0c38\u0c3f\u0c28 \u0c2b\u0c4b\u0c1f\u0c4b ID \u0c30\u0c46\u0c02\u0c21\u0c3f\u0c02\u0c1f\u0c3f\u0c28\u0c40 \u0c2b\u0c4b\u0c1f\u0c4b \u0c24\u0c40\u0c38\u0c4d\u0c24\u0c3e\u0c30\u0c41. \u0c2e\u0c3e \u0c05\u0c27\u0c3f\u0c15\u0c3e\u0c30 \u0c38\u0c47\u0c35 \u0c2e\u0c40\u0c30\u0c41 \u0c24\u0c40\u0c38\u0c3f\u0c28 \u0c2b\u0c4b\u0c1f\u0c4b\u0c28\u0c41 \u0c2e\u0c40 ID\u0c32\u0c4b\u0c28\u0c3f \u0c2b\u0c4b\u0c1f\u0c4b\u0c24\u0c4b \u0c2a\u0c4b\u0c32\u0c4d\u0c1a\u0c21\u0c02 \u0c26\u0c4d\u0c35\u0c3e\u0c30\u0c3e \u0c2e\u0c40 \u0c17\u0c41\u0c30\u0c4d\u0c24\u0c3f\u0c02\u0c2a\u0c41\u0c28\u0c41 \u0c28\u0c3f\u0c30\u0c4d\u0c27\u0c3e\u0c30\u0c3f\u0c38\u0c4d\u0c24\u0c41\u0c02\u0c26\u0c3f.",
    "As part of the verification process, you take a photo of both your face and a photo ID. Our authorization service confirms your identity by comparing the photo you take with the photo on your ID.": "\u0c27\u0c43\u0c35\u0c40\u0c15\u0c30\u0c23 \u0c2a\u0c4d\u0c30\u0c15\u0c4d\u0c30\u0c3f\u0c2f\u0c32\u0c4b \u0c2d\u0c3e\u0c17\u0c02\u0c17\u0c3e, \u0c2e\u0c40\u0c30\u0c41 \u0c2e\u0c40 \u0c2e\u0c41\u0c16\u0c02 \u0c2e\u0c30\u0c3f\u0c2f\u0c41 \u0c2b\u0c4b\u0c1f\u0c4b ID \u0c30\u0c46\u0c02\u0c21\u0c3f\u0c02\u0c1f\u0c3f\u0c28\u0c40 \u0c2b\u0c4b\u0c1f\u0c4b \u0c24\u0c40\u0c38\u0c4d\u0c24\u0c3e\u0c30\u0c41. \u0c2e\u0c40\u0c30\u0c41 \u0c24\u0c40\u0c38\u0c3f\u0c28 \u0c2b\u0c4b\u0c1f\u0c4b\u0c28\u0c41 \u0c2e\u0c40 ID\u0c32\u0c4b\u0c28\u0c3f \u0c2b\u0c4b\u0c1f\u0c4b\u0c24\u0c4b \u0c2a\u0c4b\u0c32\u0c4d\u0c1a\u0c21\u0c02 \u0c26\u0c4d\u0c35\u0c3e\u0c30\u0c3e \u0c2e\u0c3e \u0c05\u0c27\u0c3f\u0c15\u0c3e\u0c30 \u0c38\u0c47\u0c35 \u0c2e\u0c40 \u0c17\u0c41\u0c30\u0c4d\u0c24\u0c3f\u0c02\u0c2a\u0c41\u0c28\u0c41 \u0c28\u0c3f\u0c30\u0c4d\u0c27\u0c3e\u0c30\u0c3f\u0c38\u0c4d\u0c24\u0c41\u0c02\u0c26\u0c3f.",
    "As you complete courses, you will see them listed here.": "\u0c2e\u0c40\u0c30\u0c41 \u0c15\u0c4b\u0c30\u0c4d\u0c38\u0c41\u0c32\u0c28\u0c41 \u0c2a\u0c42\u0c30\u0c4d\u0c24\u0c3f \u0c1a\u0c47\u0c38\u0c3f\u0c28\u0c2a\u0c4d\u0c2a\u0c41\u0c21\u0c41, \u0c2e\u0c40\u0c30\u0c41 \u0c35\u0c3e\u0c1f\u0c3f\u0c28\u0c3f \u0c07\u0c15\u0c4d\u0c15\u0c21 \u0c1c\u0c3e\u0c2c\u0c3f\u0c24\u0c3e \u0c1a\u0c47\u0c2f\u0c21\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c1a\u0c42\u0c38\u0c4d\u0c24\u0c3e\u0c30\u0c41.",
