    "Help make edX better for everyone!": "\u0c2a\u0c4d\u0c30\u0c24\u0c3f \u0c12\u0c15\u0c4d\u0c15\u0c30\u0c3f\u0c15\u0c40 edX\u0c28\u0c3f \u0c2e\u0c46\u0c30\u0c41\u0c17\u0c41\u0c2a\u0c30\u0c1a\u0c21\u0c02\u0c32\u0c4b \u0c38\u0c39\u0c3e\u0c2f\u0c2a\u0c21\u0c02\u0c21\u0c3f!",
    "Help other learners decide whether to join your team by specifying some characteristics for your team. Choose carefully, because fewer people might be interested in joining your team if it seems too restrictive.": "\u0c2e\u0c40 \u0c2c\u0c43\u0c02\u0c26\u0c02 \u0c15\u0c4b\u0c38\u0c02 \u0c15\u0c4a\u0c28\u0c4d\u0c28\u0c3f \u0c32\u0c15\u0c4d\u0c37\u0c23\u0c3e\u0c32\u0c28\u0c41 \u0c2a\u0c47\u0c30\u0c4d\u0c15\u0c4a\u0c28\u0c21\u0c02 \u0c26\u0c4d\u0c35\u0c3e\u0c30\u0c3e \u0c2e\u0c40 \u0c2c\u0c43\u0c02\u0c26\u0c02\u0c32\u0c4b \u0c1a\u0c47\u0c30\u0c3e\u0c32\u0c3e \u0c35\u0c26\u0c4d\u0c26\u0c3e \u0c05\u0c28\u0c3f \u0c28\u0c3f\u0c30\u0c4d\u0c23\u0c2f\u0c3f\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c35\u0c21\u0c02\u0c32\u0c4b \u0c07\u0c24\u0c30 \u0c05\u0c2d\u0c4d\u0c2f\u0c3e\u0c38\u0c15\u0c41\u0c32\u0c15\u0c41 \u0c38\u0c39\u0c3e\u0c2f\u0c02 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f. \u0c1c\u0c3e\u0c17\u0c4d\u0c30\u0c24\u0c4d\u0c24\u0c17\u0c3e \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f, \u0c0e\u0c02\u0c26\u0c41\u0c15\u0c02\u0c1f\u0c47 \u0c1a\u0c3e\u0c32\u0c3e \u0c24\u0c15\u0c4d\u0c15\u0c41\u0c35 \u0c2e\u0c02\u0c26\u0c3f \u0c35\u0c4d\u0c2f\u0c15\u0c4d\u0c24\u0c41\u0c32\u0c41 \u0c2e\u0c40 \u0c2c\u0c43\u0c02\u0c26\u0c02\u0c32\u0c4b \u0c1a\u0c47\u0c30\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c06\u0c38\u0c15\u0c4d\u0c24\u0c3f \u0c1a\u0c42\u0c2a\u0c35\u0c1a\u0c4d\u0c1a\u0c41, \u0c12\u0c15\u0c35\u0c47\u0c33 \u0c05\u0c26\u0c3f \u0c1a\u0c3e\u0c32\u0c3e \u0c28\u0c3f\u0c30\u0c4d\u0c2c\u0c02\u0c27\u0c02\u0c17\u0c3e \u0c09\u0c02\u0c26\u0c3f.",
    "Hidden in the course outline, but sections are accessible for your learners through their separate link.": "\u0c15\u0c4b\u0c30\u0c4d\u0c38\u0c41 \u0c05\u0c35\u0c41\u0c1f\u0c4d\u200c\u0c32\u0c48\u0c28\u0c4d\u200c\u0c32\u0c4b \u0c26\u0c3e\u0c1a\u0c2c\u0c21\u0c3f\u0c02\u0c26\u0c3f, \u0c15\u0c3e\u0c28\u0c40 \u0c2e\u0c40 \u0c05\u0c2d\u0c4d\u0c2f\u0c3e\u0c38\u0c15\u0c41\u0c32\u0c41 \u0c35\u0c3e\u0c30\u0c3f \u0c2a\u0c4d\u0c30\u0c24\u0c4d\u0c2f\u0c47\u0c15 \u0c32\u0c3f\u0c02\u0c15\u0c4d \u0c26\u0c4d\u0c35\u0c3e\u0c30\u0c3e \u0c35\u0c3f\u0c2d\u0c3e\u0c17\u0c3e\u0c32\u0c28\u0c41 \u0c2f\u0c3e\u0c15\u0c4d\u0c38\u0c46\u0c38\u0c4d \u0c1a\u0c47\u0c2f\u0c35\u0c1a\u0c4d\u0c1a\u0c41.",
