    "Import YouTube Transcript": "YouTube \u0c32\u0c3f\u0c2a\u0c4d\u0c2f\u0c02\u0c24\u0c30\u0c40\u0c15\u0c30\u0c23\u0c28\u0c41 \u0c26\u0c3f\u0c17\u0c41\u0c2e\u0c24\u0c3f \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "In Progress": "\u0c2a\u0c41\u0c30\u0c4b\u0c17\u0c24\u0c3f\u0c32\u0c4b \u0c09\u0c02\u0c26\u0c3f",
    "In order to sign in, you need to activate your account.{line_break}{line_break}We just sent an activation link to {strong_start} {email} {strong_end}. If  you do not receive an email, check your spam folders or  {anchorStart}contact {platform_name} Support{anchorEnd}.": "\u0c38\u0c48\u0c28\u0c4d \u0c07\u0c28\u0c4d \u0c1a\u0c47\u0c2f\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f, \u0c2e\u0c40\u0c30\u0c41 \u0c2e\u0c40 \u0c16\u0c3e\u0c24\u0c3e\u0c28\u0c41 \u0c38\u0c15\u0c4d\u0c30\u0c3f\u0c2f\u0c02 \u0c1a\u0c47\u0c2f\u0c3e\u0c32\u0c3f. {line_break} {line_break} \u0c2e\u0c47\u0c2e\u0c41 \u0c07\u0c2a\u0c4d\u0c2a\u0c41\u0c21\u0c47 {strong_start} {email} {strong_end} \u0c15\u0c3f \u0c2f\u0c3e\u0c15\u0c4d\u0c1f\u0c3f\u0c35\u0c47\u0c37\u0c28\u0c4d \u0c32\u0c3f\u0c02\u0c15\u0c4d\u200c\u0c28\u0c3f \u0c2a\u0c02\u0c2a\u0c3e\u0c2e\u0c41. \u0c2e\u0c40\u0c15\u0c41 \u0c07\u0c2e\u0c46\u0c2f\u0c3f\u0c32\u0c4d \u0c05\u0c02\u0c26\u0c15\u0c2a\u0c4b\u0c24\u0c47, \u0c2e\u0c40 \u0c38\u0c4d\u0c2a\u0c3e\u0c2e\u0c4d \u0c2b\u0c4b\u0c32\u0c4d\u0c21\u0c30\u0c4d\u200c\u0c32\u0c28\u0c41 \u0c24\u0c28\u0c3f\u0c16\u0c40 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f \u0c32\u0c47\u0c26\u0c3e {anchorStart} \u0c38\u0c02\u0c2a\u0c4d\u0c30\u0c26\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f {platform_name} \u0c2e\u0c26\u0c4d\u0c26\u0c24\u0c41 {anchorEnd} .",
    "In the {linkStart}Course Outline{linkEnd}, use this group to control access to a component.": "{linkStart} \u0c15\u0c4b\u0c30\u0c4d\u0c38\u0c41 \u0c05\u0c35\u0c41\u0c1f\u0c4d\u200c\u0c32\u0c48\u0c28\u0c4d {linkEnd} \u0c32\u0c4b, \u0c12\u0c15 \u0c15\u0c3e\u0c02\u0c2a\u0c4b\u0c28\u0c46\u0c02\u0c1f\u0c4d\u200c\u0c15\u0c3f \u0c2f\u0c3e\u0c15\u0c4d\u0c38\u0c46\u0c38\u0c4d\u200c\u0c28\u0c3f \u0c28\u0c3f\u0c2f\u0c02\u0c24\u0c4d\u0c30\u0c3f\u0c02\u0c1a\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c08 \u0c17\u0c4d\u0c30\u0c42\u0c2a\u0c4d\u200c\u0c28\u0c3f \u0c09\u0c2a\u0c2f\u0c4b\u0c17\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f.",
    "Inactive subscription": "\u0c28\u0c3f\u0c37\u0c4d\u0c15\u0c4d\u0c30\u0c3f\u0c2f \u0c38\u0c2d\u0c4d\u0c2f\u0c24\u0c4d\u0c35\u0c02",
    "Incorrect url format.": "\u0c38\u0c30\u0c3f\u0c15\u0c3e\u0c28\u0c3f url \u0c2b\u0c3e\u0c30\u0c4d\u0c2e\u0c3e\u0c1f\u0c4d.",
    "Increase indent": "\u0c07\u0c02\u0c21\u0c46\u0c02\u0c1f\u0c4d \u0c2a\u0c46\u0c02\u0c1a\u0c02\u0c21\u0c3f",
