    "Introduction to Cookie Baking": "\u0c15\u0c41\u0c15\u0c40 \u0c2c\u0c47\u0c15\u0c3f\u0c02\u0c17\u0c4d \u0c2a\u0c30\u0c3f\u0c1a\u0c2f\u0c02",
    "Invalid email address: {email}": "\u0c1a\u0c46\u0c32\u0c4d\u0c32\u0c28\u0c3f \u0c07\u0c2e\u0c46\u0c2f\u0c3f\u0c32\u0c4d \u0c1a\u0c3f\u0c30\u0c41\u0c28\u0c3e\u0c2e\u0c3e: {email}",
    "Invalidate Certificate": "\u0c38\u0c30\u0c4d\u0c1f\u0c3f\u0c2b\u0c3f\u0c15\u0c46\u0c1f\u0c4d \u0c1a\u0c46\u0c32\u0c4d\u0c32\u0c26\u0c41",
    "Invalidated": "\u0c1a\u0c46\u0c32\u0c4d\u0c32\u0c28\u0c3f\u0c26\u0c3f",
    "Invalidated By": "\u0c26\u0c4d\u0c35\u0c3e\u0c30\u0c3e \u0c1a\u0c46\u0c32\u0c4d\u0c32\u0c41\u0c2c\u0c3e\u0c1f\u0c41 \u0c15\u0c3e\u0c32\u0c47\u0c26\u0c41",
