    "Is your name on your ID readable?": "\u0c2e\u0c40 ID\u0c32\u0c4b \u0c2e\u0c40 \u0c2a\u0c47\u0c30\u0c41 \u0c1a\u0c26\u0c35\u0c17\u0c32\u0c3f\u0c17\u0c47\u0c32\u0c3e \u0c09\u0c02\u0c26\u0c3e?",
    "It is intentionally hidden from learners, ensuring that only the course staff can view its contents.": "\u0c07\u0c26\u0c3f \u0c09\u0c26\u0c4d\u0c26\u0c47\u0c36\u0c2a\u0c42\u0c30\u0c4d\u0c35\u0c15\u0c02\u0c17\u0c3e \u0c05\u0c2d\u0c4d\u0c2f\u0c3e\u0c38\u0c15\u0c41\u0c32 \u0c28\u0c41\u0c02\u0c21\u0c3f \u0c26\u0c3e\u0c1a\u0c2c\u0c21\u0c3f\u0c02\u0c26\u0c3f, \u0c15\u0c4b\u0c30\u0c4d\u0c38\u0c41 \u0c38\u0c3f\u0c2c\u0c4d\u0c2c\u0c02\u0c26\u0c3f \u0c2e\u0c3e\u0c24\u0c4d\u0c30\u0c2e\u0c47 \u0c26\u0c3e\u0c28\u0c3f \u0c15\u0c02\u0c1f\u0c46\u0c02\u0c1f\u0c4d\u200c\u0c32\u0c28\u0c41 \u0c1a\u0c42\u0c21\u0c17\u0c32\u0c30\u0c28\u0c3f \u0c28\u0c3f\u0c30\u0c4d\u0c27\u0c3e\u0c30\u0c3f\u0c38\u0c4d\u0c24\u0c41\u0c02\u0c26\u0c3f.",
    "It is intentionally hidden from standard navigation, ensuring that only individuals with the link can view its contents.": "\u0c07\u0c26\u0c3f \u0c09\u0c26\u0c4d\u0c26\u0c47\u0c36\u0c2a\u0c42\u0c30\u0c4d\u0c35\u0c15\u0c02\u0c17\u0c3e \u0c2a\u0c4d\u0c30\u0c3e\u0c2e\u0c3e\u0c23\u0c3f\u0c15 \u0c28\u0c3e\u0c35\u0c3f\u0c17\u0c47\u0c37\u0c28\u0c4d \u0c28\u0c41\u0c02\u0c21\u0c3f \u0c26\u0c3e\u0c1a\u0c2c\u0c21\u0c3f\u0c02\u0c26\u0c3f, \u0c32\u0c3f\u0c02\u0c15\u0c4d\u200c\u0c28\u0c41 \u0c15\u0c32\u0c3f\u0c17\u0c3f \u0c09\u0c28\u0c4d\u0c28 \u0c35\u0c4d\u0c2f\u0c15\u0c4d\u0c24\u0c41\u0c32\u0c41 \u0c2e\u0c3e\u0c24\u0c4d\u0c30\u0c2e\u0c47 \u0c26\u0c3e\u0c28\u0c3f \u0c15\u0c02\u0c1f\u0c46\u0c02\u0c1f\u0c4d\u200c\u0c32\u0c28\u0c41 \u0c35\u0c40\u0c15\u0c4d\u0c37\u0c3f\u0c02\u0c1a\u0c17\u0c32\u0c30\u0c28\u0c3f \u0c28\u0c3f\u0c30\u0c4d\u0c27\u0c3e\u0c30\u0c3f\u0c38\u0c4d\u0c24\u0c41\u0c02\u0c26\u0c3f.",
    "It is strongly recommended that you include four or fewer signatories. If you include additional signatories, preview the certificate in Print View to ensure the certificate will print correctly on one page.": "\u0c2e\u0c40\u0c30\u0c41 \u0c28\u0c32\u0c41\u0c17\u0c41\u0c30\u0c41 \u0c32\u0c47\u0c26\u0c3e \u0c05\u0c02\u0c24\u0c15\u0c02\u0c1f\u0c47 \u0c24\u0c15\u0c4d\u0c15\u0c41\u0c35 \u0c2e\u0c02\u0c26\u0c3f \u0c38\u0c02\u0c24\u0c15\u0c3e\u0c32\u0c28\u0c41 \u0c1a\u0c47\u0c30\u0c4d\u0c1a\u0c41\u0c15\u0c4b\u0c35\u0c3e\u0c32\u0c28\u0c3f \u0c17\u0c1f\u0c4d\u0c1f\u0c3f\u0c17\u0c3e \u0c38\u0c3f\u0c2b\u0c3e\u0c30\u0c4d\u0c38\u0c41 \u0c1a\u0c47\u0c2f\u0c2c\u0c21\u0c3f\u0c02\u0c26\u0c3f. \u0c2e\u0c40\u0c30\u0c41 \u0c05\u0c26\u0c28\u0c2a\u0c41 \u0c38\u0c02\u0c24\u0c15\u0c02\u0c26\u0c3e\u0c30\u0c41\u0c32\u0c28\u0c41 \u0c1a\u0c47\u0c30\u0c4d\u0c1a\u0c3f\u0c28\u0c1f\u0c4d\u0c32\u0c2f\u0c3f\u0c24\u0c47, \u0c38\u0c30\u0c4d\u0c1f\u0c3f\u0c2b\u0c3f\u0c15\u0c47\u0c1f\u0c4d \u0c12\u0c15 \u0c2a\u0c47\u0c1c\u0c40\u0c32\u0c4b \u0c38\u0c30\u0c3f\u0c17\u0c4d\u0c17\u0c3e \u0c2e\u0c41\u0c26\u0c4d\u0c30\u0c3f\u0c02\u0c1a\u0c2c\u0c21\u0c41\u0c24\u0c41\u0c02\u0c26\u0c28\u0c3f \u0c28\u0c3f\u0c30\u0c4d\u0c27\u0c3e\u0c30\u0c3f\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c35\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c2a\u0c4d\u0c30\u0c3f\u0c02\u0c1f\u0c4d \u0c35\u0c4d\u0c2f\u0c42\u0c32\u0c4b \u0c38\u0c30\u0c4d\u0c1f\u0c3f\u0c2b\u0c3f\u0c15\u0c47\u0c1f\u0c4d\u200c\u0c28\u0c41 \u0c2a\u0c4d\u0c30\u0c3f\u0c35\u0c4d\u0c2f\u0c42 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f.",
    "It is visible to learners, ensuring that all learners can view its contents.": "\u0c07\u0c26\u0c3f \u0c05\u0c2d\u0c4d\u0c2f\u0c3e\u0c38\u0c15\u0c41\u0c32\u0c15\u0c41 \u0c15\u0c28\u0c3f\u0c2a\u0c3f\u0c38\u0c4d\u0c24\u0c41\u0c02\u0c26\u0c3f, \u0c05\u0c2d\u0c4d\u0c2f\u0c3e\u0c38\u0c15\u0c41\u0c32\u0c02\u0c26\u0c30\u0c42 \u0c26\u0c3e\u0c28\u0c3f \u0c15\u0c02\u0c1f\u0c46\u0c02\u0c1f\u0c4d\u200c\u0c32\u0c28\u0c41 \u0c35\u0c40\u0c15\u0c4d\u0c37\u0c3f\u0c02\u0c1a\u0c17\u0c32\u0c30\u0c28\u0c3f \u0c28\u0c3f\u0c30\u0c4d\u0c27\u0c3e\u0c30\u0c3f\u0c38\u0c4d\u0c24\u0c41\u0c02\u0c26\u0c3f.",
