    "Load next {numResponses} responses": "\u0c24\u0c26\u0c41\u0c2a\u0c30\u0c3f {numResponses} \u0c2a\u0c4d\u0c30\u0c24\u0c3f\u0c38\u0c4d\u0c2a\u0c02\u0c26\u0c28\u0c32\u0c28\u0c41 \u0c32\u0c4b\u0c21\u0c4d \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Load next {num_items} result": [
      "\u0c24\u0c26\u0c41\u0c2a\u0c30\u0c3f {num_items} \u0c2b\u0c32\u0c3f\u0c24\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c32\u0c4b\u0c21\u0c4d \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
      "\u0c24\u0c26\u0c41\u0c2a\u0c30\u0c3f {num_items} \u0c2b\u0c32\u0c3f\u0c24\u0c3e\u0c32\u0c28\u0c41 \u0c32\u0c4b\u0c21\u0c4d \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f"
    ],
