    "MB": "MB",
    "Make Visible to Students": "\u0c35\u0c3f\u0c26\u0c4d\u0c2f\u0c3e\u0c30\u0c4d\u0c25\u0c41\u0c32\u0c15\u0c41 \u0c15\u0c28\u0c3f\u0c2a\u0c3f\u0c02\u0c1a\u0c47\u0c32\u0c3e \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Make sure that the full name on your account matches the name on your ID.": "\u0c2e\u0c40 \u0c16\u0c3e\u0c24\u0c3e\u0c32\u0c4b\u0c28\u0c3f \u0c2a\u0c42\u0c30\u0c4d\u0c24\u0c3f \u0c2a\u0c47\u0c30\u0c41 \u0c2e\u0c40 ID\u0c32\u0c4b\u0c28\u0c3f \u0c2a\u0c47\u0c30\u0c41\u0c24\u0c4b \u0c38\u0c30\u0c3f\u0c2a\u0c4b\u0c32\u0c41\u0c24\u0c41\u0c02\u0c26\u0c28\u0c3f \u0c28\u0c3f\u0c30\u0c4d\u0c27\u0c3e\u0c30\u0c3f\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f.",
    "Make sure we can verify your identity with the photos and information you have provided.": "\u0c2e\u0c40\u0c30\u0c41 \u0c05\u0c02\u0c26\u0c3f\u0c02\u0c1a\u0c3f\u0c28 \u0c2b\u0c4b\u0c1f\u0c4b\u0c32\u0c41 \u0c2e\u0c30\u0c3f\u0c2f\u0c41 \u0c38\u0c2e\u0c3e\u0c1a\u0c3e\u0c30\u0c02\u0c24\u0c4b \u0c2e\u0c47\u0c2e\u0c41 \u0c2e\u0c40 \u0c17\u0c41\u0c30\u0c4d\u0c24\u0c3f\u0c02\u0c2a\u0c41\u0c28\u0c41 \u0c27\u0c43\u0c35\u0c40\u0c15\u0c30\u0c3f\u0c02\u0c1a\u0c17\u0c32\u0c2e\u0c28\u0c3f \u0c28\u0c3f\u0c30\u0c4d\u0c27\u0c3e\u0c30\u0c3f\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f.",
    "Make sure your ID is well-lit": "\u0c2e\u0c40 ID \u0c2c\u0c3e\u0c17\u0c3e \u0c35\u0c46\u0c32\u0c41\u0c17\u0c41\u0c24\u0c41\u0c28\u0c4d\u0c28\u0c1f\u0c4d\u0c32\u0c41 \u0c28\u0c3f\u0c30\u0c4d\u0c27\u0c3e\u0c30\u0c3f\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f",
    "Make sure your face is well-lit": "\u0c2e\u0c40 \u0c2e\u0c41\u0c16\u0c02 \u0c2c\u0c3e\u0c17\u0c3e \u0c35\u0c46\u0c32\u0c3f\u0c17\u0c3f\u0c2a\u0c4b\u0c2f\u0c47\u0c32\u0c3e \u0c1a\u0c42\u0c38\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f",
