    "Navigate up": "\u0c2a\u0c48\u0c15\u0c3f \u0c28\u0c3e\u0c35\u0c3f\u0c17\u0c47\u0c1f\u0c4d \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
