    "No EdX Timed Transcript": "EdX \u0c1f\u0c48\u0c2e\u0c4d\u0c21\u0c4d \u0c1f\u0c4d\u0c30\u0c3e\u0c28\u0c4d\u0c38\u0c4d\u0c15\u0c4d\u0c30\u0c3f\u0c2a\u0c4d\u0c1f\u0c4d \u0c32\u0c47\u0c26\u0c41",
    "No Flash Detected": "\u0c2b\u0c4d\u0c32\u0c3e\u0c37\u0c4d \u0c0f\u0c26\u0c40 \u0c15\u0c28\u0c41\u0c17\u0c4a\u0c28\u0c2c\u0c21\u0c32\u0c47\u0c26\u0c41",
    "No Timed Transcript": "\u0c38\u0c2e\u0c2f\u0c3e\u0c28\u0c41\u0c15\u0c42\u0c32 \u0c1f\u0c4d\u0c30\u0c3e\u0c28\u0c4d\u0c38\u0c4d\u0c15\u0c4d\u0c30\u0c3f\u0c2a\u0c4d\u0c1f\u0c4d \u0c32\u0c47\u0c26\u0c41",
    "No Webcam Detected": "\u0c35\u0c46\u0c2c\u0c4d\u200c\u0c15\u0c4d\u0c2f\u0c3e\u0c2e\u0c4d \u0c15\u0c28\u0c41\u0c17\u0c4a\u0c28\u0c2c\u0c21\u0c32\u0c47\u0c26\u0c41",
    "No assignments for team": "\u0c1c\u0c1f\u0c4d\u0c1f\u0c41 \u0c15\u0c4b\u0c38\u0c02 \u0c05\u0c38\u0c48\u0c28\u0c4d\u200c\u0c2e\u0c46\u0c02\u0c1f\u0c4d\u200c\u0c32\u0c41 \u0c32\u0c47\u0c35\u0c41",
    "No color": "\u0c30\u0c02\u0c17\u0c41 \u0c32\u0c47\u0c26\u0c41",
    "No content-specific discussion topics exist.": "\u0c15\u0c02\u0c1f\u0c46\u0c02\u0c1f\u0c4d-\u0c28\u0c3f\u0c30\u0c4d\u0c26\u0c3f\u0c37\u0c4d\u0c1f \u0c1a\u0c30\u0c4d\u0c1a\u0c3e \u0c05\u0c02\u0c36\u0c3e\u0c32\u0c41 \u0c32\u0c47\u0c35\u0c41.",
    "No description available": "\u0c35\u0c3f\u0c35\u0c30\u0c23 \u0c05\u0c02\u0c26\u0c41\u0c2c\u0c3e\u0c1f\u0c41\u0c32\u0c4b \u0c32\u0c47\u0c26\u0c41",
    "No posts matched your query.": "\u0c2e\u0c40 \u0c2a\u0c4d\u0c30\u0c36\u0c4d\u0c28\u0c15\u0c41 \u0c0f \u0c2a\u0c4b\u0c38\u0c4d\u0c1f\u0c4d\u200c\u0c32\u0c41 \u0c38\u0c30\u0c3f\u0c2a\u0c4b\u0c32\u0c32\u0c47\u0c26\u0c41.",
    "No prerequisite": "\u0c2e\u0c41\u0c02\u0c26\u0c38\u0c4d\u0c24\u0c41 \u0c05\u0c35\u0c38\u0c30\u0c02 \u0c32\u0c47\u0c26\u0c41",
    "No results": "\u0c2b\u0c32\u0c3f\u0c24\u0c3e\u0c32\u0c41 \u0c32\u0c47\u0c35\u0c41",
    "No results found for \"{query_string}\". Please try searching again.": "&quot; {query_string} &quot; \u0c15\u0c4b\u0c38\u0c02 \u0c2b\u0c32\u0c3f\u0c24\u0c3e\u0c32\u0c41 \u0c15\u0c28\u0c41\u0c17\u0c4a\u0c28\u0c2c\u0c21\u0c32\u0c47\u0c26\u0c41. \u0c26\u0c2f\u0c1a\u0c47\u0c38\u0c3f \u0c2e\u0c33\u0c4d\u0c32\u0c40 \u0c35\u0c46\u0c24\u0c15\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c2a\u0c4d\u0c30\u0c2f\u0c24\u0c4d\u0c28\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f.",
    "No results found for {original_query}. Showing results for {suggested_query}.": "{original_query} \u0c15\u0c4b\u0c38\u0c02 \u0c2b\u0c32\u0c3f\u0c24\u0c3e\u0c32\u0c41 \u0c15\u0c28\u0c41\u0c17\u0c4a\u0c28\u0c2c\u0c21\u0c32\u0c47\u0c26\u0c41. {suggested_query} \u0c15\u0c4b\u0c38\u0c02 \u0c2b\u0c32\u0c3f\u0c24\u0c3e\u0c32\u0c28\u0c41 \u0c1a\u0c42\u0c2a\u0c41\u0c24\u0c4b\u0c02\u0c26\u0c3f.",
    "No tasks currently running.": "\u0c2a\u0c4d\u0c30\u0c38\u0c4d\u0c24\u0c41\u0c24\u0c02 \u0c2a\u0c28\u0c41\u0c32\u0c41 \u0c0f\u0c35\u0c40 \u0c05\u0c2e\u0c32\u0c41\u0c32\u0c4b \u0c32\u0c47\u0c35\u0c41.",
    "No transcript uploaded.": "\u0c1f\u0c4d\u0c30\u0c3e\u0c28\u0c4d\u0c38\u0c4d\u0c15\u0c4d\u0c30\u0c3f\u0c2a\u0c4d\u0c1f\u0c4d \u0c05\u0c2a\u0c4d\u0c32\u0c4b\u0c21\u0c4d \u0c1a\u0c47\u0c2f\u0c2c\u0c21\u0c32\u0c47\u0c26\u0c41.",
    "No validation is performed on policy keys or value pairs. If you are having difficulties, check your formatting.": "\u0c35\u0c3f\u0c27\u0c3e\u0c28 \u0c15\u0c40\u0c32\u0c41 \u0c32\u0c47\u0c26\u0c3e \u0c35\u0c3f\u0c32\u0c41\u0c35 \u0c1c\u0c24\u0c32\u0c2a\u0c48 \u0c0e\u0c1f\u0c41\u0c35\u0c02\u0c1f\u0c3f \u0c27\u0c43\u0c35\u0c40\u0c15\u0c30\u0c23 \u0c28\u0c3f\u0c30\u0c4d\u0c35\u0c39\u0c3f\u0c02\u0c1a\u0c2c\u0c21\u0c26\u0c41. \u0c2e\u0c40\u0c15\u0c41 \u0c07\u0c2c\u0c4d\u0c2c\u0c02\u0c26\u0c41\u0c32\u0c41 \u0c09\u0c02\u0c1f\u0c47, \u0c2e\u0c40 \u0c2b\u0c3e\u0c30\u0c4d\u0c2e\u0c3e\u0c1f\u0c3f\u0c02\u0c17\u0c4d\u200c\u0c28\u0c3f \u0c24\u0c28\u0c3f\u0c16\u0c40 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f.",
    "Nonbreaking space": "\u0c28\u0c3e\u0c28\u0c4d\u200c\u0c2c\u0c4d\u0c30\u0c47\u0c15\u0c3f\u0c02\u0c17\u0c4d \u0c38\u0c4d\u0c2a\u0c47\u0c38\u0c4d",
    "Noncommercial": "\u0c35\u0c3e\u0c23\u0c3f\u0c1c\u0c4d\u0c2f\u0c47\u0c24\u0c30",
    "None": "\u0c0f\u0c26\u0c40 \u0c32\u0c47\u0c26\u0c41",
    "Noon": "\u0c2e\u0c27\u0c4d\u0c2f\u0c3e\u0c39\u0c4d\u0c28\u0c2e\u0c41",
