    "Not able to set passing grade to less than %(minimum_grade_cutoff)s%.": "\u0c09\u0c24\u0c4d\u0c24\u0c40\u0c30\u0c4d\u0c23\u0c24 \u0c17\u0c4d\u0c30\u0c47\u0c21\u0c4d\u200c\u0c28\u0c3f %(minimum_grade_cutoff)s % \u0c15\u0c02\u0c1f\u0c47 \u0c24\u0c15\u0c4d\u0c15\u0c41\u0c35\u0c15\u0c41 \u0c38\u0c46\u0c1f\u0c4d \u0c1a\u0c47\u0c2f\u0c21\u0c02 \u0c38\u0c3e\u0c27\u0c4d\u0c2f\u0c2a\u0c21\u0c32\u0c47\u0c26\u0c41.",
    "Not divided": "\u0c35\u0c3f\u0c2d\u0c1c\u0c3f\u0c02\u0c1a\u0c2c\u0c21\u0c32\u0c47\u0c26\u0c41",
    "Not in Use": "\u0c35\u0c3e\u0c21\u0c41\u0c15\u0c32\u0c4b \u0c32\u0c47\u0c26\u0c41",
