    "Remaining": "\u0c2e\u0c3f\u0c17\u0c3f\u0c32\u0c3f\u0c02\u0c26\u0c3f",
    "Removal is in progress. To avoid errors, stay on this page until the process is complete.": "\u0c24\u0c4a\u0c32\u0c17\u0c3f\u0c02\u0c2a\u0c41 \u0c2a\u0c41\u0c30\u0c4b\u0c17\u0c24\u0c3f\u0c32\u0c4b \u0c09\u0c02\u0c26\u0c3f. \u0c32\u0c4b\u0c2a\u0c3e\u0c32\u0c28\u0c41 \u0c28\u0c3f\u0c35\u0c3e\u0c30\u0c3f\u0c02\u0c1a\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f, \u0c2a\u0c4d\u0c30\u0c15\u0c4d\u0c30\u0c3f\u0c2f \u0c2a\u0c42\u0c30\u0c4d\u0c24\u0c2f\u0c4d\u0c2f\u0c47 \u0c35\u0c30\u0c15\u0c41 \u0c08 \u0c2a\u0c47\u0c1c\u0c40\u0c32\u0c4b \u0c09\u0c02\u0c21\u0c02\u0c21\u0c3f.",
    "Remove": "\u0c24\u0c4a\u0c32\u0c17\u0c3f\u0c02\u0c1a\u0c41",
