    "Remove unit %(unitName)s": "\u0c2f\u0c42\u0c28\u0c3f\u0c1f\u0c4d %(unitName)s \u0c28\u0c3f \u0c24\u0c40\u0c38\u0c3f\u0c35\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Remove {role} Access": "{role} \u0c2f\u0c3e\u0c15\u0c4d\u0c38\u0c46\u0c38\u0c4d\u200c\u0c28\u0c3f \u0c24\u0c40\u0c38\u0c3f\u0c35\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Remove {video_name} video": "{video_name} \u0c35\u0c40\u0c21\u0c3f\u0c2f\u0c4b\u0c28\u0c3f \u0c24\u0c40\u0c38\u0c3f\u0c35\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Removing": "\u0c24\u0c4a\u0c32\u0c17\u0c3f\u0c38\u0c4d\u0c24\u0c4b\u0c02\u0c26\u0c3f",
    "Removing a video from this list does not affect course content. Any content that uses a previously uploaded video ID continues to display in the course.": "\u0c08 \u0c1c\u0c3e\u0c2c\u0c3f\u0c24\u0c3e \u0c28\u0c41\u0c02\u0c21\u0c3f \u0c35\u0c40\u0c21\u0c3f\u0c2f\u0c4b\u0c28\u0c41 \u0c24\u0c40\u0c38\u0c3f\u0c35\u0c47\u0c2f\u0c21\u0c02 \u0c35\u0c32\u0c28 \u0c15\u0c4b\u0c30\u0c4d\u0c38\u0c41 \u0c15\u0c02\u0c1f\u0c46\u0c02\u0c1f\u0c4d\u200c\u0c2a\u0c48 \u0c2a\u0c4d\u0c30\u0c2d\u0c3e\u0c35\u0c02 \u0c09\u0c02\u0c21\u0c26\u0c41. \u0c2e\u0c41\u0c28\u0c41\u0c2a\u0c41 \u0c05\u0c2a\u0c4d\u200c\u0c32\u0c4b\u0c21\u0c4d \u0c1a\u0c47\u0c38\u0c3f\u0c28 \u0c35\u0c40\u0c21\u0c3f\u0c2f\u0c4b ID\u0c28\u0c3f \u0c09\u0c2a\u0c2f\u0c4b\u0c17\u0c3f\u0c02\u0c1a\u0c47 \u0c0f\u0c26\u0c48\u0c28\u0c3e \u0c15\u0c02\u0c1f\u0c46\u0c02\u0c1f\u0c4d \u0c15\u0c4b\u0c30\u0c4d\u0c38\u0c41\u0c32\u0c4b \u0c2a\u0c4d\u0c30\u0c26\u0c30\u0c4d\u0c36\u0c3f\u0c02\u0c1a\u0c2c\u0c21\u0c41\u0c24\u0c42\u0c28\u0c47 \u0c09\u0c02\u0c1f\u0c41\u0c02\u0c26\u0c3f.",
    "Replace": "\u0c2d\u0c30\u0c4d\u0c24\u0c40 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Replace all": "\u0c05\u0c28\u0c4d\u0c28\u0c3f\u0c02\u0c1f\u0c3f\u0c28\u0c40 \u0c2d\u0c30\u0c4d\u0c24\u0c40 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Replace with": "\u0c24\u0c4b \u0c2d\u0c30\u0c4d\u0c24\u0c40 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Reply to Annotation": "\u0c09\u0c32\u0c4d\u0c32\u0c47\u0c16\u0c28\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c2a\u0c4d\u0c30\u0c24\u0c4d\u0c2f\u0c41\u0c24\u0c4d\u0c24\u0c30\u0c02 \u0c07\u0c35\u0c4d\u0c35\u0c02\u0c21\u0c3f",
    "Report": "\u0c28\u0c3f\u0c35\u0c47\u0c26\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f",
    "Report abuse": "\u0c26\u0c41\u0c30\u0c4d\u0c35\u0c3f\u0c28\u0c3f\u0c2f\u0c4b\u0c17\u0c2e\u0c46\u0c56\u0c24\u0c47",
    "Report abuse, topics, and responses": "\u0c26\u0c41\u0c30\u0c4d\u0c35\u0c3f\u0c28\u0c3f\u0c2f\u0c4b\u0c17\u0c02, \u0c05\u0c02\u0c36\u0c3e\u0c32\u0c41 \u0c2e\u0c30\u0c3f\u0c2f\u0c41 \u0c2a\u0c4d\u0c30\u0c24\u0c3f\u0c38\u0c4d\u0c2a\u0c02\u0c26\u0c28\u0c32\u0c28\u0c41 \u0c28\u0c3f\u0c35\u0c47\u0c26\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f",
    "Reported": "\u0c28\u0c3f\u0c35\u0c47\u0c26\u0c3f\u0c02\u0c1a\u0c2c\u0c21\u0c3f\u0c02\u0c26\u0c3f",
    "Requester": "\u0c05\u0c2d\u0c4d\u0c2f\u0c30\u0c4d\u0c27\u0c15\u0c41\u0c21\u0c41",
    "Required": "\u0c05\u0c35\u0c38\u0c30\u0c02",
    "Required field.": "\u0c15\u0c3e\u0c35\u0c32\u0c38\u0c3f\u0c28 \u0c38\u0c2e\u0c3e\u0c1a\u0c3e\u0c30\u0c02.",
    "Rescore problem '<%- problem_id %>' for all students?": "\u0c35\u0c3f\u0c26\u0c4d\u0c2f\u0c3e\u0c30\u0c4d\u0c25\u0c41\u0c32\u0c02\u0c26\u0c30\u0c3f\u0c15\u0c40 &#39;&lt;%- problem_id %&gt;&#39; \u0c38\u0c2e\u0c38\u0c4d\u0c2f\u0c28\u0c41 \u0c2a\u0c41\u0c28\u0c30\u0c41\u0c26\u0c4d\u0c27\u0c30\u0c3f\u0c02\u0c1a\u0c3e\u0c32\u0c3e?",
    "Reset My Password": "\u0c28\u0c3e \u0c2a\u0c3e\u0c38\u0c4d\u200c\u0c35\u0c30\u0c4d\u0c21\u0c4d\u200c\u0c28\u0c3f \u0c30\u0c40\u0c38\u0c46\u0c1f\u0c4d \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Reset Password": "\u0c30\u0c39\u0c38\u0c4d\u0c2f\u0c2a\u0c26\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c2e\u0c3e\u0c30\u0c4d\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f",
    "Reset Your Password": "\u0c2e\u0c40 \u0c38\u0c3e\u0c02\u0c15\u0c47\u0c24\u0c3f\u0c15 \u0c2a\u0c26\u0c2e\u0c41 \u0c2e\u0c3e\u0c30\u0c4d\u0c1a\u0c02\u0c21\u0c3f",
    "Reset attempts for all students on problem '<%- problem_id %>'?": "&#39;&lt;%- problem_id %&gt;&#39; \u0c38\u0c2e\u0c38\u0c4d\u0c2f\u0c2a\u0c48 \u0c35\u0c3f\u0c26\u0c4d\u0c2f\u0c3e\u0c30\u0c4d\u0c25\u0c41\u0c32\u0c02\u0c26\u0c30\u0c3f\u0c15\u0c40 \u0c2a\u0c4d\u0c30\u0c2f\u0c24\u0c4d\u0c28\u0c3e\u0c32\u0c28\u0c41 \u0c30\u0c40\u0c38\u0c46\u0c1f\u0c4d \u0c1a\u0c47\u0c2f\u0c3e\u0c32\u0c3e?",
    "Responses could not be loaded. Refresh the page and try again.": "\u0c2a\u0c4d\u0c30\u0c24\u0c3f\u0c38\u0c4d\u0c2a\u0c02\u0c26\u0c28\u0c32\u0c28\u0c41 \u0c32\u0c4b\u0c21\u0c4d \u0c1a\u0c47\u0c2f\u0c21\u0c02 \u0c38\u0c3e\u0c27\u0c4d\u0c2f\u0c2a\u0c21\u0c32\u0c47\u0c26\u0c41. \u0c2a\u0c47\u0c1c\u0c40\u0c28\u0c3f \u0c30\u0c3f\u0c2b\u0c4d\u0c30\u0c46\u0c37\u0c4d \u0c1a\u0c47\u0c38\u0c3f, \u0c2e\u0c33\u0c4d\u0c32\u0c40 \u0c2a\u0c4d\u0c30\u0c2f\u0c24\u0c4d\u0c28\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f.",
    "Restart my subscription": "\u0c28\u0c3e \u0c38\u0c2d\u0c4d\u0c2f\u0c24\u0c4d\u0c35\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c2a\u0c41\u0c28\u0c03\u0c2a\u0c4d\u0c30\u0c3e\u0c30\u0c02\u0c2d\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f",
    "Restart your subscription for {subscriptionPrice}. Your payment history is still available on the {a_start}Orders and subscriptions{a_end} page": "{subscriptionPrice} \u0c15\u0c4b\u0c38\u0c02 \u0c2e\u0c40 \u0c38\u0c2d\u0c4d\u0c2f\u0c24\u0c4d\u0c35\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c2a\u0c41\u0c28\u0c03\u0c2a\u0c4d\u0c30\u0c3e\u0c30\u0c02\u0c2d\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f. \u0c2e\u0c40 \u0c1a\u0c46\u0c32\u0c4d\u0c32\u0c3f\u0c02\u0c2a\u0c41 \u0c1a\u0c30\u0c3f\u0c24\u0c4d\u0c30 \u0c07\u0c2a\u0c4d\u0c2a\u0c1f\u0c3f\u0c15\u0c40 {a_start} \u0c06\u0c30\u0c4d\u0c21\u0c30\u0c4d\u200c\u0c32\u0c41 \u0c2e\u0c30\u0c3f\u0c2f\u0c41 \u0c38\u0c2c\u0c4d\u200c\u0c38\u0c4d\u0c15\u0c4d\u0c30\u0c3f\u0c2a\u0c4d\u0c37\u0c28\u0c4d\u200c\u0c32\u0c41 {a_end} \u0c2a\u0c47\u0c1c\u0c40\u0c32\u0c4b \u0c05\u0c02\u0c26\u0c41\u0c2c\u0c3e\u0c1f\u0c41\u0c32\u0c4b \u0c09\u0c02\u0c26\u0c3f",
    "Restore enrollment code": "\u0c28\u0c2e\u0c4b\u0c26\u0c41 \u0c15\u0c4b\u0c21\u0c4d\u200c\u0c28\u0c3f \u0c2a\u0c41\u0c28\u0c30\u0c41\u0c26\u0c4d\u0c27\u0c30\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f",
    "Restore last draft": "\u0c1a\u0c3f\u0c35\u0c30\u0c3f \u0c1a\u0c3f\u0c24\u0c4d\u0c24\u0c41\u0c2a\u0c4d\u0c30\u0c24\u0c3f\u0c28\u0c3f \u0c2a\u0c41\u0c28\u0c30\u0c41\u0c26\u0c4d\u0c27\u0c30\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f",
    "Restrict access to:": "\u0c35\u0c40\u0c1f\u0c3f\u0c15\u0c3f \u0c2a\u0c4d\u0c30\u0c3e\u0c2a\u0c4d\u0c2f\u0c24\u0c28\u0c41 \u0c2a\u0c30\u0c3f\u0c2e\u0c3f\u0c24\u0c02 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f:",
    "Retake Photo": "\u0c2b\u0c4b\u0c1f\u0c4b\u0c28\u0c41 \u0c2e\u0c33\u0c4d\u0c32\u0c40 \u0c24\u0c40\u0c2f\u0c02\u0c21\u0c3f",
    "Retake Your Photos": "\u0c2e\u0c40 \u0c2b\u0c4b\u0c1f\u0c4b\u0c32\u0c28\u0c41 \u0c2e\u0c33\u0c4d\u0c32\u0c40 \u0c24\u0c40\u0c2f\u0c02\u0c21\u0c3f",
    "Retrieving enrollment status...": "\u0c28\u0c2e\u0c4b\u0c26\u0c41 \u0c38\u0c4d\u0c25\u0c3f\u0c24\u0c3f\u0c28\u0c3f \u0c24\u0c3f\u0c30\u0c3f\u0c17\u0c3f \u0c2a\u0c4a\u0c02\u0c26\u0c41\u0c24\u0c4b\u0c02\u0c26\u0c3f...",
    "Return and add email address": "\u0c24\u0c3f\u0c30\u0c3f\u0c17\u0c3f \u0c35\u0c1a\u0c4d\u0c1a\u0c3f \u0c07\u0c2e\u0c46\u0c2f\u0c3f\u0c32\u0c4d \u0c1a\u0c3f\u0c30\u0c41\u0c28\u0c3e\u0c2e\u0c3e\u0c28\u0c41 \u0c1c\u0c4b\u0c21\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f",
    "Return to Export": "\u0c0e\u0c17\u0c41\u0c2e\u0c24\u0c3f\u0c15\u0c3f \u0c24\u0c3f\u0c30\u0c3f\u0c17\u0c3f \u0c35\u0c46\u0c33\u0c4d\u0c33\u0c41",
    "Return to Your Dashboard": "\u0c2e\u0c40 \u0c21\u0c3e\u0c37\u0c4d\u200c\u0c2c\u0c4b\u0c30\u0c4d\u0c21\u0c4d\u200c\u0c15\u0c3f \u0c24\u0c3f\u0c30\u0c3f\u0c17\u0c3f \u0c35\u0c46\u0c33\u0c4d\u0c32\u0c02\u0c21\u0c3f",
    "Return to all posts": "\u0c05\u0c28\u0c4d\u0c28\u0c3f \u0c2a\u0c4b\u0c38\u0c4d\u0c1f\u0c4d\u200c\u0c32\u0c15\u0c41 \u0c24\u0c3f\u0c30\u0c3f\u0c17\u0c3f \u0c35\u0c46\u0c33\u0c4d\u0c33\u0c41",
