    "Select a category": "\u0c12\u0c15 \u0c35\u0c30\u0c4d\u0c17\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4a\u0c28\u0c41\u0c2e\u0c41",
    "Select a chapter": "\u0c12\u0c15 \u0c05\u0c27\u0c4d\u0c2f\u0c3e\u0c2f\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f",
