    "Select a cohort to manage": "\u0c28\u0c3f\u0c30\u0c4d\u0c35\u0c39\u0c3f\u0c02\u0c1a\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c38\u0c2e\u0c3f\u0c37\u0c4d\u0c1f\u0c3f\u0c28\u0c3f \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f",
    "Select a course or select \"Not specific to a course\" for your support request.": "\u0c2e\u0c40 \u0c2e\u0c26\u0c4d\u0c26\u0c24\u0c41 \u0c05\u0c2d\u0c4d\u0c2f\u0c30\u0c4d\u0c25\u0c28 \u0c15\u0c4b\u0c38\u0c02 \u0c15\u0c4b\u0c30\u0c4d\u0c38\u0c41\u0c28\u0c41 \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f \u0c32\u0c47\u0c26\u0c3e &quot;\u0c15\u0c4b\u0c30\u0c4d\u0c38\u0c41\u0c15\u0c41 \u0c28\u0c3f\u0c30\u0c4d\u0c26\u0c3f\u0c37\u0c4d\u0c1f\u0c2e\u0c48\u0c28\u0c26\u0c3f \u0c15\u0c3e\u0c26\u0c41&quot; \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f.",
    "Select a group type": "\u0c38\u0c2e\u0c42\u0c39 \u0c30\u0c15\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f",
    "Select a prerequisite subsection and enter a minimum score percentage and minimum completion percentage to limit access to this subsection. Allowed values are 0-100": "\u0c08 \u0c09\u0c2a\u0c35\u0c3f\u0c2d\u0c3e\u0c17\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c2a\u0c4d\u0c30\u0c3e\u0c2a\u0c4d\u0c2f\u0c24\u0c28\u0c41 \u0c2a\u0c30\u0c3f\u0c2e\u0c3f\u0c24\u0c02 \u0c1a\u0c47\u0c2f\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c2e\u0c41\u0c02\u0c26\u0c38\u0c4d\u0c24\u0c41 \u0c09\u0c2a\u0c35\u0c3f\u0c2d\u0c3e\u0c17\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c41\u0c28\u0c3f, \u0c15\u0c28\u0c40\u0c38 \u0c38\u0c4d\u0c15\u0c4b\u0c30\u0c4d \u0c36\u0c3e\u0c24\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c2e\u0c30\u0c3f\u0c2f\u0c41 \u0c15\u0c28\u0c40\u0c38 \u0c2a\u0c42\u0c30\u0c4d\u0c24\u0c3f \u0c36\u0c3e\u0c24\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c28\u0c2e\u0c4b\u0c26\u0c41 \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f. \u0c05\u0c28\u0c41\u0c2e\u0c24\u0c3f\u0c02\u0c1a\u0c2c\u0c21\u0c3f\u0c28 \u0c35\u0c3f\u0c32\u0c41\u0c35\u0c32\u0c41 0-100",
    "Select a section or problem": "\u0c35\u0c3f\u0c2d\u0c3e\u0c17\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c32\u0c47\u0c26\u0c3e \u0c38\u0c2e\u0c38\u0c4d\u0c2f\u0c28\u0c41 \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f",
    "Select a session:": "\u0c38\u0c46\u0c37\u0c28\u0c4d\u200c\u0c28\u0c41 \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f:",
    "Select a subject for your support request.": "\u0c2e\u0c40 \u0c2e\u0c26\u0c4d\u0c26\u0c24\u0c41 \u0c05\u0c2d\u0c4d\u0c2f\u0c30\u0c4d\u0c25\u0c28 \u0c15\u0c4b\u0c38\u0c02 \u0c12\u0c15 \u0c05\u0c02\u0c36\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f.",
    "Select a time allotment for the exam. If it is over 24 hours, type in the amount of time. You can grant individual learners extra time to complete the exam through the Instructor Dashboard.": "\u0c2a\u0c30\u0c40\u0c15\u0c4d\u0c37 \u0c15\u0c4b\u0c38\u0c02 \u0c38\u0c2e\u0c2f\u0c02 \u0c15\u0c47\u0c1f\u0c3e\u0c2f\u0c3f\u0c02\u0c2a\u0c41\u0c28\u0c41 \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c02\u0c21\u0c3f. \u0c07\u0c26\u0c3f 24 \u0c17\u0c02\u0c1f\u0c32 \u0c15\u0c02\u0c1f\u0c47 \u0c0e\u0c15\u0c4d\u0c15\u0c41\u0c35\u0c17\u0c3e \u0c09\u0c02\u0c1f\u0c47, \u0c38\u0c2e\u0c2f\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c1f\u0c48\u0c2a\u0c4d \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f. \u0c2e\u0c40\u0c30\u0c41 \u0c07\u0c28\u0c4d\u200c\u0c38\u0c4d\u0c1f\u0c4d\u0c30\u0c15\u0c4d\u0c1f\u0c30\u0c4d \u0c21\u0c4d\u0c2f\u0c3e\u0c37\u0c4d\u200c\u0c2c\u0c4b\u0c30\u0c4d\u0c21\u0c4d \u0c26\u0c4d\u0c35\u0c3e\u0c30\u0c3e \u0c2a\u0c30\u0c40\u0c15\u0c4d\u0c37\u0c28\u0c41 \u0c2a\u0c42\u0c30\u0c4d\u0c24\u0c3f \u0c1a\u0c47\u0c2f\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c35\u0c4d\u0c2f\u0c15\u0c4d\u0c24\u0c3f\u0c17\u0c24 \u0c05\u0c2d\u0c4d\u0c2f\u0c3e\u0c38\u0c15\u0c41\u0c32\u0c15\u0c41 \u0c05\u0c26\u0c28\u0c2a\u0c41 \u0c38\u0c2e\u0c2f\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c2e\u0c02\u0c1c\u0c42\u0c30\u0c41 \u0c1a\u0c47\u0c2f\u0c35\u0c1a\u0c4d\u0c1a\u0c41.",
