    "Student": "\u0c35\u0c3f\u0c26\u0c4d\u0c2f\u0c3e\u0c30\u0c4d\u0c25\u0c3f",
    "Student Removed from certificate allowlist successfully.": "\u0c38\u0c30\u0c4d\u0c1f\u0c3f\u0c2b\u0c3f\u0c15\u0c47\u0c1f\u0c4d \u0c05\u0c28\u0c41\u0c2e\u0c24\u0c3f \u0c1c\u0c3e\u0c2c\u0c3f\u0c24\u0c3e \u0c28\u0c41\u0c02\u0c21\u0c3f \u0c35\u0c3f\u0c26\u0c4d\u0c2f\u0c3e\u0c30\u0c4d\u0c25\u0c3f \u0c35\u0c3f\u0c1c\u0c2f\u0c35\u0c02\u0c24\u0c02\u0c17\u0c3e \u0c24\u0c40\u0c38\u0c3f\u0c35\u0c47\u0c2f\u0c2c\u0c21\u0c4d\u0c21\u0c3e\u0c30\u0c41.",
    "Student email or username": "\u0c35\u0c3f\u0c26\u0c4d\u0c2f\u0c3e\u0c30\u0c4d\u0c25\u0c3f \u0c07\u0c2e\u0c46\u0c2f\u0c3f\u0c32\u0c4d \u0c32\u0c47\u0c26\u0c3e \u0c35\u0c3f\u0c28\u0c3f\u0c2f\u0c4b\u0c17\u0c26\u0c3e\u0c30\u0c41 \u0c2a\u0c47\u0c30\u0c41",
    "Student username/email field is required and can not be empty. Kindly fill in username/email and then press \"Add to Exception List\" button.": "\u0c35\u0c3f\u0c26\u0c4d\u0c2f\u0c3e\u0c30\u0c4d\u0c25\u0c3f \u0c35\u0c3f\u0c28\u0c3f\u0c2f\u0c4b\u0c17\u0c26\u0c3e\u0c30\u0c41 \u0c2a\u0c47\u0c30\u0c41/\u0c07\u0c2e\u0c46\u0c2f\u0c3f\u0c32\u0c4d \u0c2b\u0c40\u0c32\u0c4d\u0c21\u0c4d \u0c05\u0c35\u0c38\u0c30\u0c02 \u0c2e\u0c30\u0c3f\u0c2f\u0c41 \u0c16\u0c3e\u0c33\u0c40\u0c17\u0c3e \u0c09\u0c02\u0c21\u0c15\u0c42\u0c21\u0c26\u0c41. \u0c26\u0c2f\u0c1a\u0c47\u0c38\u0c3f \u0c35\u0c3f\u0c28\u0c3f\u0c2f\u0c4b\u0c17\u0c26\u0c3e\u0c30\u0c41 \u0c2a\u0c47\u0c30\u0c41/\u0c07\u0c2e\u0c46\u0c2f\u0c3f\u0c32\u0c4d\u200c\u0c28\u0c3f \u0c2a\u0c42\u0c30\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f, \u0c06\u0c2a\u0c48 &quot;\u0c2e\u0c3f\u0c28\u0c39\u0c3e\u0c2f\u0c3f\u0c02\u0c2a\u0c41 \u0c1c\u0c3e\u0c2c\u0c3f\u0c24\u0c3e\u0c15\u0c41 \u0c1c\u0c4b\u0c21\u0c3f\u0c02\u0c1a\u0c41&quot; \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c28\u0c41 \u0c28\u0c4a\u0c15\u0c4d\u0c15\u0c02\u0c21\u0c3f.",
    "Student username/email field is required and can not be empty. Kindly fill in username/email and then press \"Invalidate Certificate\" button.": "\u0c35\u0c3f\u0c26\u0c4d\u0c2f\u0c3e\u0c30\u0c4d\u0c25\u0c3f \u0c35\u0c3f\u0c28\u0c3f\u0c2f\u0c4b\u0c17\u0c26\u0c3e\u0c30\u0c41 \u0c2a\u0c47\u0c30\u0c41/\u0c07\u0c2e\u0c46\u0c2f\u0c3f\u0c32\u0c4d \u0c2b\u0c40\u0c32\u0c4d\u0c21\u0c4d \u0c05\u0c35\u0c38\u0c30\u0c02 \u0c2e\u0c30\u0c3f\u0c2f\u0c41 \u0c16\u0c3e\u0c33\u0c40\u0c17\u0c3e \u0c09\u0c02\u0c21\u0c15\u0c42\u0c21\u0c26\u0c41. \u0c26\u0c2f\u0c1a\u0c47\u0c38\u0c3f \u0c35\u0c3f\u0c28\u0c3f\u0c2f\u0c4b\u0c17\u0c26\u0c3e\u0c30\u0c41 \u0c2a\u0c47\u0c30\u0c41/\u0c07\u0c2e\u0c46\u0c2f\u0c3f\u0c32\u0c4d\u200c\u0c28\u0c3f \u0c2a\u0c42\u0c30\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f, \u0c06\u0c2a\u0c48 &quot;\u0c38\u0c30\u0c4d\u0c1f\u0c3f\u0c2b\u0c3f\u0c15\u0c47\u0c1f\u0c4d \u0c1a\u0c46\u0c32\u0c4d\u0c32\u0c41\u0c2c\u0c3e\u0c1f\u0c41 \u0c15\u0c3e\u0c26\u0c41&quot; \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c28\u0c41 \u0c28\u0c4a\u0c15\u0c4d\u0c15\u0c02\u0c21\u0c3f.",
    "Studio's having trouble parsing the problem component's content": "\u0c38\u0c2e\u0c38\u0c4d\u0c2f \u0c15\u0c3e\u0c02\u0c2a\u0c4b\u0c28\u0c46\u0c02\u0c1f\u0c4d \u0c15\u0c02\u0c1f\u0c46\u0c02\u0c1f\u0c4d\u200c\u0c28\u0c3f \u0c05\u0c28\u0c4d\u0c35\u0c2f\u0c3f\u0c02\u0c1a\u0c21\u0c02\u0c32\u0c4b \u0c38\u0c4d\u0c1f\u0c42\u0c21\u0c3f\u0c2f\u0c4b \u0c38\u0c2e\u0c38\u0c4d\u0c2f\u0c28\u0c41 \u0c0e\u0c26\u0c41\u0c30\u0c4d\u0c15\u0c4a\u0c02\u0c1f\u0c4b\u0c02\u0c26\u0c3f",
