    "These users were not removed as beta testers:": "\u0c08 \u0c35\u0c3f\u0c28\u0c3f\u0c2f\u0c4b\u0c17\u0c26\u0c3e\u0c30\u0c41\u0c32\u0c41 \u0c2c\u0c40\u0c1f\u0c3e \u0c1f\u0c46\u0c38\u0c4d\u0c1f\u0c30\u0c4d\u200c\u0c17\u0c3e \u0c24\u0c40\u0c38\u0c3f\u0c35\u0c47\u0c2f\u0c2c\u0c21\u0c32\u0c47\u0c26\u0c41:",
