    "Unlink This Account": "\u0c08 \u0c16\u0c3e\u0c24\u0c3e\u0c28\u0c41 \u0c05\u0c28\u0c4d\u200c\u0c32\u0c3f\u0c02\u0c15\u0c4d \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Unlink your {accountName} account": "\u0c2e\u0c40 {accountName} \u0c16\u0c3e\u0c24\u0c3e\u0c28\u0c41 \u0c05\u0c28\u0c4d\u200c\u0c32\u0c3f\u0c02\u0c15\u0c4d \u0c1a\u0c47\u0c2f\u0c02\u0c21\u0c3f",
    "Unlinking": "\u0c05\u0c28\u0c4d\u200c\u0c32\u0c3f\u0c02\u0c15\u0c4d \u0c1a\u0c47\u0c38\u0c4d\u0c24\u0c4b\u0c02\u0c26\u0c3f",
